import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/landing.css";

const LandingPage = () => {
  const navigate = useNavigate();

  return (
    <div className="landing">
      {/* ===== Navbar ===== */}
      <nav className="landing-navbar">
        <h2 className="logo">PrimeTrade<span>AI</span></h2>
        <div className="nav-actions">
          <button className="nav-btn" onClick={() => navigate("/signup")}>Sign Up</button>
          <button className="nav-btn login" onClick={() => navigate("/login")}>Login</button>
        </div>
      </nav>

      {/* ===== Hero Section ===== */}
      <div className="hero">
        <div className="hero-content">
          <h1 className="animated-text">
            <span>Welcome&nbsp;to</span> <br />
            <span className="highlight">PrimeTrade AI</span>
          </h1>
          <p className="tagline">
            Empowering Smart Investments with AI-Driven Precision
          </p>
        </div>
      </div>

      {/* Optional Footer */}
      <footer className="footer">
        <p>© 2025 PrimeTrade AI – All Rights Reserved</p>
      </footer>
    </div>
  );
};

export default LandingPage;
